import { useState } from "react";
import { Routes, Route, Link } from "react-router-dom";
import Header from "../components/Header";


const Inscription =()=> {
    const [pseudo,setPseudo]=useState('')
    const [email,setEmail]=useState('')
    const [password,setPassword]=useState('')


    return ( 
        <div className="inscription">
             <Header prop={ [<Link to="/connexion">Connexion</Link>,
             <Link to="/">Accueil</Link>]}/>
            <h1>Inscription</h1>

            <form>
            <div className='form'>
                <label>Pseudo</label>
                <input type='text' id='pseudo' onKeyUp={(e)=>{setPseudo(e.target.value)}}/>
                </div>
                <div className='form'>
                <label>Adresse mail</label>
                <input type='text' id='mail' onKeyUp={(e)=>{setEmail(e.target.value)}}/>
                </div>
                <div className='form'>
                <label>Mot de passe</label>
                <input type='password' id='password' onKeyUp={(e)=>{setPassword(e.target.value)}}/>
                <button type='submit'><Link to="/connexion">Valider</Link></button>
                </div>
            </form>
        </div>
     );
}

export default Inscription ;
